import React from "react";

function template() {
  const { students, fnDelete } = this.props;
  console.log("hi" + students);
  return (
    <div className="Table.css">
    <h1 className="text-center">Students</h1>
    <div className="table-responsive">
      {/* <table className="table table-bordered"> */}

        {/* <tr>
          <th>ID</th>
          <th>Name</th>
          <th>Class</th>
          <th>Location</th>
          <th>Edit</th>
          <th>Delete</th>
        </tr> */}

          {students.map((obj) => {
          return <tr>
            <td>{obj.stu_id}</td>
            <td>{obj.stu_name}</td>
            <td>{obj.stu_class}</td>
            <td>{obj.stu_location}</td>
            <td><button className="btn btn-primary">EDIT</button></td>
            <td><button onClick={() => fnDelete(obj.id)} className="btn btn-danger">Delete</button></td>
             <td  className="btn btn-primary">Edit</td>
          </tr>
        })
        }


      {/* </table> */}
    </div>
  </div>
  );
};

export default template;
